        protected override void BuildRenderTree(Microsoft.AspNetCore.Components.Rendering.RenderTreeBuilder __builder)
        {
            __builder.AddMarkupContent(0, "<section class=\"showcase\">\r\n    <div class=\"container-fluid p-0\">\r\n        <div class=\"row no-gutters\">\r\n            <div class=\"col-lg-6 order-lg-2 text-white showcase-img\"></div>\r\n            <div class=\"col-lg-6 order-lg-1 my-auto showcase-text\">\r\n                <p class=\"lead mb-0\">\r\n                    Thank you for choosing to be part of our community at INFORMATIK LLC, doing business as Doulab\r\n                    (<b>“Doulab”</b>, <b>“we”</b>, <b>“us”</b>, or <b>“our”</b>). We are committed to protecting your personal information and your right to privacy. If you have any questions or concerns about our policy, or our practices with regards to your personal information, please contact us at <a href=\"mailto:together@themicrocanvas.com\">together@themicrocanvas.com</a>.\r\n                </p>\r\n\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    When you visit our website <a href=\"https://themicrocanvas.com\">https://themicrocanvas.com</a>, mobile application, and use our services, you trust us with your personal information. We take your privacy very seriously. In this privacy notice, we describe our privacy policy. We seek to explain to you in the clearest way possible what information we collect, how we use it and what rights you have in relation to it. We hope you take some time to read through it carefully, as it is important. If there are any terms in this privacy policy that you do not agree with, please discontinue`use of our Sites or Apps and our services.\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    This privacy policy applies to all information collected through our website (such as\r\n                    <a href=\"https://themicrocanvas.com\">https://themicrocanvas.com</a>), mobile application, (<b>\"Apps\"</b>), and/or any related services, sales, marketing or events (we refer to them collectively in this privacy policy as the <b>\"Sites\"</b>).\r\n                </p>\r\n\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    <strong>\r\n                        Please read this privacy policy carefully as it will help you make informed decisions about sharing\r\n                        your personal information with us.\r\n                    </strong>\r\n                </p>\r\n                <p></p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    <h2>TABLE OF CONTENTS</h2>\r\n                    <ol>\r\n                        <li><a href=\"#collect\">WHAT INFORMATION DO WE COLLECT?</a></li>\r\n                        <li><a href=\"#use\">HOW DO WE USE YOUR INFORMATION?</a></li>\r\n                        <li><a href=\"#shared\">WILL YOUR INFORMATION BE SHARED WITH ANYONE?</a></li>\r\n                        <li><a href=\"#cookies\">DO WE USE COOKIES AND OTHER TRACKING TECHNOLOGIES?</a></li>\r\n                        <li><a href=\"#keep\">HOW LONG DO WE KEEP YOUR INFORMATION?</a></li>\r\n                        <li><a href=\"#safe\">HOW DO WE KEEP YOUR INFORMATION SAFE?</a></li>\r\n                        <li><a href=\"#minors\">DO WE COLLECT INFORMATION FROM MINORS?</a></li>\r\n                        <li><a href=\"#privacy\">WHAT ARE YOUR PRIVACY RIGHTS?</a></li>\r\n                        <li><a href=\"#donottrack\">CONTROLS FOR DO-NOT-TRACK FEATURES</a></li>\r\n                        <li><a href=\"#california\">DO CALIFORNIA RESIDENTS HAVE SPECIFIC PRIVACY RIGHTS?</a></li>\r\n                        <li><a href=\"#updates\">DO WE MAKE UPDATES TO THIS POLICY?</a></li>\r\n                        <li><a href=\"#contact\">HOW CAN YOU CONTACT US ABOUT THIS POLICY?</a></li>\r\n                    </ol>\r\n                </p>\r\n\r\n                <p></p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\" id=\"collect\">\r\n                    <h2>1. WHAT INFORMATION DO WE COLLECT?</h2>\r\n                    <h3>Personal information you disclose to us</h3>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    <em>\r\n                        <strong>In Short</strong>: We collect personal information that you provide to us such as name, address, contact information, passwords and security data, and payment information.\r\n                    </em>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    The personal information that we collect depends on the context of your interactions with us and the Sites\r\n                    or Apps, the choices you make and the products and features you use. The personal information we collect\r\n                    can include the following:\r\n\r\n                    <br>\r\n                    <br>\r\n                    <strong>Name and Contact Data</strong>. We collect your first and last name, email address, postal address, phone\r\n                    number, and other similar contact data.\r\n                    <br>\r\n                    <br>\r\n                    <strong>Credentials</strong>. We collect passwords, password hints, and similar security information used for\r\n                    authentication and account access.\r\n                    <br>\r\n                    <br>\r\n                    <strong>Payment Data</strong>. We collect data necessary to process your payment if you make purchases, such as your payment instrument number (such as a credit card number), and the security code associated with your\r\n                    payment instrument. All payment data is stored by our payment processor and you should review its\r\n                    privacy policies and contact the payment processor directly to respond to your questions.\r\n                    <br>\r\n                    <br>\r\n                    All personal information that you provide to us must be true, complete and accurate, and you must notify us of any changes to such personal information.\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    <h2>Information collected through our Apps</h2>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    <em>\r\n                        <strong>In Short</strong>: We may collect information regarding your push notifications, when you use our apps.\r\n                    </em>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    If you use our Apps, we may also collect the following information:\r\n\r\n                    <br>\r\n                    <br>\r\n                    <ul>\r\n                        <li>\r\n                            <em>Push Notifications</em>. We may request to send you push notifications regarding your account or the mobile application. If you wish to opt-out from receiving these types of communications, you may turn them off in your device’s settings.\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    <h2>\r\n                        Information collected from other sources\r\n                    </h2>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    <em>\r\n                        <strong>In Short</strong>: We may collect limited data from public databases, marketing partners, and other outside sources.\r\n                    </em>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    We may obtain information about you from other sources, such as public databases, joint marketing\r\n                    partners, as well as from other third parties. Examples of the information we receive from other sources\r\n                    include: social media profile information; marketing leads and search results and links, including paid\r\n                    listings (such as sponsored links).\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\" id=\"use\">\r\n                    <h1>2. HOW DO WE USE YOUR INFORMATION?</h1>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    <em>\r\n                        <strong>In Short</strong>: We process your information for purposes based on legitimate business interests, the fulfillment of our contract with you, compliance with our legal obligations, and/or your consent.\r\n                    </em>\r\n                </p>\r\n                <p class=\"lead mb-1\">\r\n                    We use personal information collected via our Sites or Apps for a variety of business purposes described\r\n                    below. We process your personal information for these purposes in reliance on our legitimate business\r\n                    interests, in order to enter into or perform a contract with you, with your consent, and/or for compliance with\r\n                    our legal obligations. We indicate the specific processing grounds we rely on next to each purpose listed\r\n                    below.\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    We use the information we collect or receive:\r\n                    <ul>\r\n                        <li>\r\n                            <strong>Request Feedback</strong>. We may use your information to request feedback and to contact you about your use of our Sites or Apps.\r\n                        </li>\r\n                        <li>\r\n                            <strong>For other Business Purposes</strong>. We may use your information for other Business Purposes, such as data analysis, identifying usage trends, determining the effectiveness of our promotional campaigns and to evaluate and improve our Sites or Apps, products, services, marketing and your experience.\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\" id=\"shared\">\r\n                    <h1>3. WILL YOUR INFORMATION BE SHARED WITH ANYONE?</h1>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    <em>\r\n                        <strong>In Short</strong>: We only share information with your consent, to comply with laws, to protect your rights, or to fulfill business obligations.\r\n                    </em>\r\n                    <ul>\r\n                        <li>\r\n                            <strong>Consent</strong>: We may process your data if you have given us specific consent to use your personal information in a specific purpose.\r\n                        </li>\r\n                        <li>\r\n                            <strong>Legitimate Interests</strong>: We may process your data when it is reasonably necessary to achieve our legitimate business interests.\r\n                        </li>\r\n                        <li>\r\n                            <strong>Performance of a Contract</strong>: Where we have entered into a contract with you, we may process your personal information to fulfill the terms of our contract.\r\n                        </li>\r\n                        <li>\r\n                            <strong>Legal Obligations</strong>: We may disclose your information where we are legally required to do so in order to comply with applicable law, governmental requests, a judicial proceeding, court order, or legal process, such as in response to a court order or a subpoena (including in response to public authorities to meet national security or law enforcement requirements).\r\n                        </li>\r\n                        <li>\r\n                            <strong>Vital Interests</strong>: We may disclose your information where we believe it is necessary to investigate, prevent, or take action regarding potential violations of our policies, suspected fraud, situations involving potential threats to the safety of any person and illegal activities, or as evidence in litigation in which we are involved.\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    More specifically, we may need to process your data or share your personal information in the following\r\n                    situations:\r\n                    <ul>\r\n                        <li>\r\n                            <strong>Business Transfers</strong>. We may share or transfer your information in connection with, or during negotiations of, any merger, sale of company assets, financing, or acquisition of all or a portion of our business to another company.\r\n                        </li>\r\n                        <li>\r\n                            <strong>Third-Party Advertisers</strong>. We may use third-party advertising companies to serve ads when you visit the Sites or Apps. These companies may use information about your visits to our Website(s) and other websites that are contained in web cookies and other tracking technologies in order to provide\r\n                            advertisements about goods and services of interest to you.\r\n                        </li>\r\n                    </ul>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\" id=\"cookies\">\r\n                    <h1>4. DO WE USE COOKIES AND OTHER TRACKING TECHNOLOGIES?</h1>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    <em><strong>In Short</strong>: We may use cookies and other tracking technologies to collect and store your information.</em>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    We may use cookies and similar tracking technologies (like web beacons and pixels) to access or store\r\n                    information. Specific information about how we use such technologies and how you can refuse certain\r\n                    cookies is set out in our Cookie Policy.\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\" id=\"keep\">\r\n                    <h1>5. HOW LONG DO WE KEEP YOUR INFORMATION?</h1>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    <em>\r\n                        <strong>In Short</strong>: We keep your information for as long as necessary to fulfill the purposes outlined in this privacy policy unless otherwise required by law.\r\n                    </em>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    We will only keep your personal information for as long as it is necessary for the purposes set out in this\r\n                    privacy policy, unless a longer retention period is required or permitted by law (such as tax, accounting or\r\n                    other legal requirements). No purpose in this policy will require us keeping your personal information for\r\n                    longer than 2 years.\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    When we have no ongoing legitimate business need to process your personal information, we will either\r\n                    delete or anonymize it, or, if this is not possible (for example, because your personal information has been\r\n                    stored in backup archives), then we will securely store your personal information and isolate it from any\r\n                    further processing until deletion is possible.\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\" id=\"safe\">\r\n                    <h1>\r\n                        6. HOW DO WE KEEP YOUR INFORMATION SAFE?\r\n                    </h1>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    <em>\r\n                        <strong>In Short</strong>: We aim to protect your personal information through a system of organizational and technical security measures.\r\n                    </em>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    We have implemented appropriate technical and organizational security measures designed to protect the\r\n                    security of any personal information we process. However, please also remember that we cannot\r\n                    guarantee that the internet itself is 100% secure. Although we will do our best to protect your personal\r\n                    information, transmission of personal information to and from our Sites or Apps is at your own risk. You\r\n                    should only access the services within a secure environment.\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\" id=\"minors\">\r\n                    <h1>7. DO WE COLLECT INFORMATION FROM MINORS?</h1>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    <em><strong>In Short</strong>: We do not knowingly collect data from or market to children under 18 years of age.</em>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    We do not knowingly solicit data from or market to children under 18 years of age. By using the Sites or\r\n                    Apps, you represent that you are at least 18 or that you are the parent or guardian of such a minor and\r\n                    consent to such minor dependent’s use of the Sites or Apps. If we learn that personal information from\r\n                    users less than 18 years of age has been collected, we will deactivate the account and take reasonable\r\n                    measures to promptly delete such data from our records. If you become aware of any data we have\r\n                    collected from children under age 18, please contact us at <a href=\"mailto:together@themicrocanvas.com\">together@themicrocanvas.com</a>.\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\" id=\"privacy\">\r\n                    <h1>\r\n                        8. WHAT ARE YOUR PRIVACY RIGHTS?\r\n                    </h1>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    <em>\r\n                        <strong>In Short</strong>: In some regions, such as the European Economic Area, you have rights that allow you greater access to and control over your personal information. You may review, change, or terminate your account at any time.\r\n                    </em>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    In some regions (like the European Economic Area), you have certain rights under applicable data\r\n                    protection laws. These may include the right (i) to request access and obtain a copy of your personal\r\n                    information, (ii) to request rectification or erasure; (iii) to restrict the processing of your personal\r\n                    information; and (iv) if applicable, to data portability. In certain circumstances, you may also have the right\r\n                    to object to the processing of your personal information. To make such a request, please use the <a href=\"#contact\">contact details</a> provided below. We will consider and act upon any request in accordance with applicable data protection laws.\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    If we are relying on your consent to process your personal information, you have the right to withdraw your\r\n                    consent at any time. Please note however that this will not affect the lawfulness of the processing before its\r\n                    withdrawal.\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    If you are resident in the European Economic Area and you believe we are unlawfully processing your\r\n                    personal information, you also have the right to complain to your local data protection supervisory authority.\r\n                    You can find their contact details here: <a href=\"http://ec.europa.eu/justice/dataprotection/bodies/authorities/index_en.htm\" target=\"_blank\">http://ec.europa.eu/justice/dataprotection/bodies/authorities/index_en.htm</a>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    <strong>Cookies and similar technologies</strong>: Most Web browsers are set to accept cookies by default. If you prefer, you can usually choose to set your browser to remove cookies and to reject cookies. If you choose to\r\n                    remove cookies or reject cookies, this could affect certain features or services of our Sites or Apps. To optout\r\n                    of interest-based advertising by advertisers on our Sites or Apps visit <a href=\"http://www.aboutads.info/choices/\" target=\"_blank\">http://www.aboutads.info/choices/</a>.\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\" id=\"donottrack\">\r\n                    <h1>\r\n                        9. CONTROLS FOR DO-NOT-TRACK FEATURES\r\n                    </h1>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    Most web browsers and some mobile operating systems and mobile applications include a Do-Not-Track\r\n                    (“DNT”) feature or setting you can activate to signal your privacy preference not to have data about your\r\n                    online browsing activities monitored and collected. No uniform technology standard for recognizing and\r\n                    implementing DNT signals has been finalized. As such, we do not currently respond to DNT browser\r\n                    signals or any other mechanism that automatically communicates your choice not to be tracked online. If a\r\n                    standard for online tracking is adopted that we must follow in the future, we will inform you about that\r\n                    practice in a revised version of this Privacy Policy.\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\" id=\"california\">\r\n                    <h1>\r\n                        10. DO CALIFORNIA RESIDENTS HAVE SPECIFIC PRIVACY RIGHTS?\r\n                    </h1>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    <em>\r\n                        <strong>In Short</strong>: Yes, if you are a resident of California, you are granted specific rights regarding access to your personal information.\r\n                    </em>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    California Civil Code Section 1798.83, also known as the “Shine The Light” law, permits our users who are\r\n                    California residents to request and obtain from us, once a year and free of charge, information about\r\n                    categories of personal information (if any) we disclosed to third parties for direct marketing purposes and\r\n                    the names and addresses of all third parties with which we shared personal information in the immediately\r\n                    preceding calendar year. If you are a California resident and would like to make such a request, please\r\n                    submit your request in writing to us using the contact information provided below.\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    If you are under 18 years of age, reside in California, and have a registered account with the Sites or Apps,\r\n                    you have the right to request removal of unwanted data that you publicly post on the Sites or Apps. To\r\n                    request removal of such data, please contact us using the contact information provided below, and include\r\n                    the email address associated with your account and a statement that you reside in California. We will make\r\n                    sure the data is not publicly displayed on the Sites or Apps, but please be aware that the data may not be\r\n                    completely or comprehensively removed from our systems.\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\" id=\"updates\">\r\n                    <h1>11. DO WE MAKE UPDATES TO THIS POLICY?</h1>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    <em><strong>In Short</strong>: Yes, we will update this policy as necessary to stay compliant with relevant laws.</em>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    We may update this privacy policy from time to time. The updated version will be indicated by an updated\r\n                    “Revised” date and the updated version will be effective as soon as it is accessible. If we make material\r\n                    changes to this privacy policy, we may notify you either by prominently posting a notice of such changes or\r\n                    by directly sending you a notification. We encourage you to review this privacy policy frequently to be\r\n                    informed of how we are protecting your information.\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\" id=\"contact\">\r\n                    <h1>\r\n                        12. HOW CAN YOU CONTACT US ABOUT THIS POLICY?\r\n                    </h1>\r\n                </p>\r\n                <p></p>\r\n                <p class=\"lead mb-1\">\r\n                    If you have questions or comments about this policy, you may email us at <a href=\"mailto:together@themicrocanvas.com\" target=\"_blank\">together@themicrocanvas.com</a>\r\n                    or by post to: <br>\r\n                    INFORMATIK LLC <br>\r\n                    8 The Green, Dover, DE 19901, USA <br>\r\n                    Dover, DE 19901 <br>\r\n                    United States\r\n                </p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</section>");
        }
